DROP TABLE IF EXISTS PROJECT;
DROP TABLE IF EXISTS SECURITY_TEST;
DROP TABLE IF EXISTS TEST_STATUS;
DROP TABLE IF EXISTS FINDING;

CREATE TABLE IF NOT EXISTS PROJECT (
    ID         VARCHAR(36) NOT NULL,
    CLIENT     VARCHAR(255) NOT NULL,
    TITLE      VARCHAR(255) NOT NULL,
    CREATED_AT DATETIME,
    -- DETAILS
    TESTER_NAME VARCHAR(255),
    SELECTED_LOGO_TESTER VARCHAR(36) NOT NULL,
    LOGO_CLIENT MEDIUMTEXT,
    PRIMARY KEY (ID)
);

CREATE TABLE IF NOT EXISTS SECURITY_TEST (
    ID VARCHAR(32) NOT NULL,
    CATEGORY VARCHAR(255),
    TITLE VARCHAR(255),
    DESCRIPTION TEXT,
    LINK VARCHAR(255),
    PRIMARY KEY (ID)
);

CREATE TABLE IF NOT EXISTS TEST_STATUS (
    ID VARCHAR(36) NOT NULL,
    TEST_ID VARCHAR(255) NOT NULL,
    PROJECT_ID VARCHAR(255) NOT NULL,
    TEST_PROGRESS VARCHAR(255) NOT NULL,
    CREATED DATETIME,
    PRIMARY KEY (ID)
);

CREATE TABLE IF NOT EXISTS FINDING (
    ID VARCHAR(36) NOT NULL,
    TEST_ID VARCHAR(255) NOT NULL,
    PROJECT_ID VARCHAR(255) NOT NULL,
    TITLE VARCHAR(255),
    SEVERITY VARCHAR(255),
    DESCRIPTION TEXT,
    REPRODUCTION TEXT,
    IMPACT TEXT,
    MITIGATION TEXT,
    AFFECTED_URLS TEXT,
    CREATED DATETIME,
    PRIMARY KEY (ID)
);

CREATE TABLE IF NOT EXISTS SECURITY_TEST_PERFORMED (
    ID VARCHAR(255) NOT NULL,
    PROJECT_ID VARCHAR(255) NOT NULL,
    TEST_ID VARCHAR(255) NOT NULL,
    CHECKED BOOLEAN(1) NOT NULL,
    COMMENT TEXT,
    PRIMARY KEY (ID)
);

